(1741, 216, 'servicios_portada_0_servicios_descripcion_servicio', 'Galería de servicios es un espacio a disposición de la comunidad donde los emprendedores cubanos del sector de la moda ,cosmética, belleza , cuidado personal, arte corporal y otros, podrán exhibir sus negocios y cualidades principales, este servicio forma parte del servicio básico de publicidad que brinda QTOKAO. INCLUYE TU NEGOCIO YA !! DATE A CONOCER EN NUESTRA COMUNIDAD !! Llama 53179970 whtssap.\r\n\r\nConoce a los que están ya !!'),
(1742, 216, '_servicios_portada_0_servicios_descripcion_servicio', 'field_5f41a558ae059'),
(1743, 216, 'servicios_portada_1_servicios_descripcion_servicio', 'Nuestra comunidad llena de especialistas con experiencias y en formación puede acceder de forma fácil a tu oferta de empleo, para ello brindamos nuestro servicio básico de publicación y promoción de tu oferta en el apartado EMPLEO en nuestra página. Nuestra comunidad se enriquece con esta posibilidad brindándole nuevas expectativas a nuestros usuario.\r\n\r\nSi estás interesado llama ya !! 53179970.\r\n\r\nVisita nuestra pestaña de empleo y vé las ofertas existentes'),
(1744, 216, '_servicios_portada_1_servicios_descripcion_servicio', 'field_5f41a558ae059'),
(1745, 216, 'servicios_portada_2_servicios_descripcion_servicio', 'Tenemos para nuestra comunidad maneras de colaborar con la promoción de eventos relacionados con nuestro espacio de interés, y hacer tu vínculo con QTOKAO cada vez más placentero, además brindamos diferentes servicios de covertura a tus eventos, y otros soportes que pueden hacer más atractivos tus eventos, como es el caso de nuestro servicio de sorteo digital en nuestra plataforma.\r\n\r\nPuedes para conocer algunos eventos comunicados a nuestra comunidad, visitar nuestra pestaña EVENTOS'),
(1746, 216, '_servicios_portada_2_servicios_descripcion_servicio', 'field_5f41a558ae059'),
